import React from "react";
import "./Navbar.css";
import { IoSearch } from "react-icons/io5";
import { RiUser2Fill } from "react-icons/ri";
import { SiAsus } from "react-icons/si";

function Navbar() {
  return (
    <div className="Navbar">
      <SiAsus style={{ fontSize: "50px" }} />
      <p>Mobil/Handhelds</p>
      <p>Laptops</p>
      <p>Display/Desctop</p>
      <p>Motherboards/Components</p>
      <p>Networking/lot/Servers</p>
      <p>Accessories</p>
      <p style={{ marginLeft: "30px" }}>Support</p>
      <IoSearch />
      <RiUser2Fill />
    </div>
  );
}

export default Navbar;
